import Header from "./Components/Header/Header";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="flex h-screen">
        <Sidebar />
        <div className="flex-1 flex flex-col">
          <Header />
          <main className="p-6 mt-16 bg-gray-100">محتوای اصلی</main>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
